Form-Widgets <-> Interface

Looks like we finally agreed on a solution. The solution for the user is shown in the following code snippet:

// set the values (old)
checkBox.setChecked(true);
textField.setValue("affe");
spinner.setValue(25);
dateField.setDate(new Date());
colorField.setRed(0);
colorField.setBlue(0);
colorField.setGreen(0);

// set the values (new)
checkBox.setValue(true);
textField.setValue("affe");
spinner.setValue(25);
dateField.setValue(new Date());
colorField.setValue("0xFFFFFF");


All interfaces are listed in the following section:

IExecutable
event: execute
properties: command
memeber: execute


IRange
properties: min
            singleStep
            pageStep
            max



IStringForm
IDateForm
IBooleanForm
INumberForm
IColorForm

property API for: value + event


As you can see, every type specific interface does have the same API, a value property and an event for changes. Which widget should implement which interface is shown in the attached PDF.
